import "../assets/css/video.css";

export default function Video() {
    return (
        <div classname="video">
            <video className="video__player" loop={true} src="https://download1506.mediafire.com/ih8lk7gbi4ig/kwon6hj7sgyelhx/Lizard+sneaks+up+on+dog+panics+when+spotted+_+%F0%9F%A6%8E+%F0%9F%90%B6+%F0%9F%A4%A3+shorts.mp4"></video>
        </div>
    )
}
